<script>
	export default {
		data() {
			return {
				containerLeft:0,
				containerTop:0,
				containerHeight:0,
				containerWidth:0,
				isShow:true,
				scrollTop: 0,
				old: {
					scrollTop: 0
				},
				bgImg:'/static/bg-big.png',
				action:'big',
				actionList:[
					{
						type:'big',
						url:"/static/big.jpg",
						bg:'/static/bg-big.png',
						selected:true,
					},
					{
						type:'keting',
						url:"/static/keting.jpg",
						bg:'/static/bg-keting.jpeg',
						selected:false,
					},
					{
						type:'xuanguan',
						url:"/static/xuanguan.jpg",
						bg:'/static/bg-xuanguan.jpg',
						selected:false,
					},
				],
				ajaxList:[],
				dataList:[
					{
						title:'素材选择',
						list:[]
					}
				],
				list:[],//当前显示的数据列表
				params:{
					title:''
				},
				categoryInfo:{
					title:''
				},
				cWidth:0,
				cHeight:0,
				ktPosition:{
					width:0,
					height:0,
					left:0,
					top:0,
				},
				xgPosition:{
					width:0,
					height:0,
					left:0,
					top:0,
				},
				kuangPosition:{
					top:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
					bottom:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
					left:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
					right:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
				},
				kXgPosition:{
					top:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
					bottom:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
					left:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
					right:{
						width:0,
						height:0,
						left:0,
						top:0,
					},
				},
			}
		},
		watch:{
			dataList:{
				deep:true,
				handler(newval){
					let lastList = newval[newval.length - 1]
					this.list = JSON.parse(JSON.stringify(lastList.list))
					if(this.list.length===0){
						return
					}
					this.params = {
						title:this.list[0].children?this.list[0].children[0].title:this.list[0].title,
						url:this.list[0].children?this.list[0].children[0].url:this.list[0].url,
					}
					this.categoryInfo = {
						title:lastList.title,
						isBack:newval.length>1
					}
					this.list.map(a=>{
						this.$set(a,'selected',false)
						if(!a.children && a.title === this.params.title){
							this.$set(a,'selected',true)
						}
					})
				}
			}
		},
		onLoad() {
			// console.log(uni.getSystemInfoSync().screenWidth)
			
			// //访问微信云数据库
			// //1.调用获取默认环境的数据库的引用：
			// let db = wx.cloud.database({
			// 	evn: 'movie-test-qiqjo'
			// })
			// //2.调用 get 方法获取通知的数据：
			// db.collection('filelist').get({
			// 	success: function(res) {
			// 		console.log(111,res)
			// 		/* uni.showToast({
			// 			title:res.errMsg,
			// 			icon:'none'
			// 		}) */
			// 	}
			// })
			
			wx.cloud.callFunction({
				name: 'getList',
				// data: {
				// 	"content": 1
				// }
			}).then(res => {
				this.dataList[0].list = res.result.ajaxList
				// this.dataList[0].list = [res.result.ajaxList[0]]
			})
			this.getDescBox()
		},
		methods: {
			//查看大图
			openBigImg(url){
				return
				let imgsArray = [url]
				uni.previewImage({
					urls: imgsArray
				})
			},
			//图片加载
			imgLoad(e){
				let w = e.detail.width
				let h = e.detail.height
				if(this.action==='xuanguan'){
					this.containerHeight = this.xgPosition.width * h / w
					if(this.containerHeight>this.xgPosition.height){
						this.containerHeight = this.xgPosition.height
						this.containerWidth = this.xgPosition.height * w / h
						this.containerLeft = (this.xgPosition.width-this.containerWidth)/2
						this.containerTop = 0
					}else{
						this.containerWidth = 0
						this.containerLeft = 0
						this.containerTop = (this.xgPosition.height-this.containerHeight)/2
					}
				}else if(this.action==='keting'){
					this.containerHeight = this.ktPosition.width * h / w
					if(this.containerHeight>this.ktPosition.height){
						this.containerHeight = this.ktPosition.height
						this.containerWidth = this.ktPosition.height * w / h
						this.containerLeft = (this.ktPosition.width-this.containerWidth)/2
						this.containerTop = 0
					}else{
						this.containerWidth = 0
						this.containerLeft = 0
						this.containerTop = (this.ktPosition.height-this.containerHeight)/2
					}
				}
				this.$forceUpdate()
			},
			getNewUrl(url){//url:	cloud://movie-test-qiqjo.6d6f-movie-test-qiqjo-1302443827/bg-keting.jpeg
				let index=url.lastIndexOf("/")
				let str=url.substr(index+1)
				return 'https://6d6f-movie-test-qiqjo-1302443827.tcb.qcloud.la/'+str+'?imageMogr2/thumbnail/400x400'
			},
			getDescBox() { 
			  uni.createSelectorQuery().in(this).select('.center').boundingClientRect(result => { 
			   if (result) { 
			     // console.log('==========',result) 
					 let w = result.width
					 let h = result.height - 80
					 this.cHeight = h
					 if(w*0.77>h){
						 this.cWidth = h/0.77
					 }
					 if(w*0.77<=h){
						 this.cWidth = w
					 }
					 if(this.action==='xuanguan'){
						 this.cWidth = this.cHeight
					 }
					 //客厅画框内的图片信息
					 this.ktPosition = {
						 width:this.cWidth*0.5-this.cWidth*0.042,
						 height:this.cWidth*0.5*0.4-this.cWidth*0.02,
						 left:this.cWidth*0.5-this.cWidth*0.45/2-5-this.cWidth*0.08,
						 top:this.cHeight*0.09+this.cHeight*0.013,
					 }
					 //客厅画框的信息
					 this.kuangPosition = {
						 top:{
							 width:this.cWidth*0.02*2 + this.ktPosition.width,
							 height:this.cWidth*0.038,
							 left:this.cWidth*0.5-this.cWidth*0.45/2-5-this.cWidth*0.08 - this.cWidth*0.02,
							 top:this.ktPosition.top-this.cWidth*0.038,
						 },
						 bottom:{
							 width:this.cWidth*0.02*2 + this.ktPosition.width,
							 height:this.cWidth*0.039,
							 left:this.cWidth*0.5-this.cWidth*0.45/2-5-this.cWidth*0.08 - this.cWidth*0.02,
							 top:this.ktPosition.height+this.ktPosition.top,
						 },
						 left:{
							 width:this.cWidth*0.03,
							 height:this.ktPosition.height,
							 left:this.cWidth*0.5-this.cWidth*0.45/2-5-this.cWidth*0.08 - this.cWidth*0.02,
							 top:this.ktPosition.top,
						 },
						 right:{
							 width:this.cWidth*0.03,
							 height:this.ktPosition.height,
							 left:this.ktPosition.width+this.ktPosition.left-this.cWidth*0.03/2,
							 top:this.ktPosition.top,
						 },
					 }
					 
					 //玄关画框内的图片信息
					 this.xgPosition = {
						 width:this.cWidth*0.5,
						 height:this.cWidth*0.8,
						 left:this.cWidth*0.25,
						 top:this.cHeight*0.08,
					 }
					 //玄关画框的信息
					 this.kXgPosition = {
						 top:{
							 width:this.xgPosition.width + this.cWidth*42/1000*2,
							 height:this.cHeight*42/864,
							 left:this.xgPosition.left-this.cWidth*42/1000,
							 top:this.xgPosition.top-this.cWidth*42/864,
						 },
						 bottom:{
							 width:this.cWidth*42/1000 + this.xgPosition.width + this.cWidth*43/1000,
							 height:this.cWidth*42/864,
							 left:this.xgPosition.left-this.cWidth*42/1000,
							 top:this.xgPosition.height+this.cWidth*42/864,
						 },
						 left:{
							 width:this.cWidth*42/1000*780/1000,
							 height:'100%',
							 left:this.xgPosition.left-this.cWidth*42/1000,
							 top:this.xgPosition.top,
						 },
						 right:{
							 width:this.cWidth*43/1000*780/1000,
							 height:'100%',
							 left:this.ktPosition.width+this.ktPosition.left-this.cWidth*0.03/2,
							 top:this.xgPosition.top,
						 },
					 }
			   }else { 
			     this.getDescBox(); 
			 } 
			  }).exec(); 
			},
			liChange(item){
				if(item.children){
					this.dataList.push({
						title:item.title,
						list:item.children
					})
					this.goTop()
				}else{
					this.list.map(a=>{
						this.$set(a,'selected',false)
					})
					this.$set(item,'selected',true)
					this.params = {
						title:item.title,
						url:item.url,
					}
				}
			},
			handleBack(){
				this.dataList.pop()
				this.goTop()
			},
			handleChange(item){
				this.bgImg = item.bg
				this.action = item.type
				let list = this.actionList
				list.map(a=>{
					a.selected = false
					if(a.type === item.type){
						a.selected = true
					}
				})
				this.getDescBox()
			},
			scroll(e) {
				this.old.scrollTop = e.detail.scrollTop
			},
			goTop(e) {
				this.scrollTop = this.old.scrollTop
				this.$nextTick(() => {
					this.scrollTop = 0
				})
			},
		}
	}
</script>

